import Layout from "../components/Layout";

import { Grid, Typography, Paper } from "@material-ui/core";

const About = () => (
  <Layout>
    <Grid container>
      <Grid item lg={2}></Grid>

      <Grid item lg={8}>
        <div
          style={{
            marginTop: 60,
            padding: 30,
            backgroundColor: "#eee",
          }}
        >
          <Typography variant="h2">About Tomato</Typography>
        </div>
      </Grid>

      <Grid item lg={2}></Grid>
    </Grid>
  </Layout>
);

export default About;
